import React from 'react';
import Grid from '../elements/Grid';
import Image from '../elements/Image';
import Text from  '../elements/Text';
const Post = (props) => {

    return(
        <React.Fragment>
            <Grid padding='15px' margin='10px' >

                <Grid>
                <Image shape ='rectangle' src={props.src}/>
                </Grid>

                <Grid padding="3px">
                <Text>{props.title}</Text>   
                </Grid>

                <Grid padding="3px">
                <Text bold>{props.price}</Text>
                </Grid>

                <Grid padding="3px">
                <Text size='14px'>{props.region}</Text>
                </Grid>

                <Grid padding="3px">   
                <Text size='14px'>{props.like} {props.chat}</Text>

                </Grid>

            </Grid>    



        </React.Fragment>

    )

    }

    Post.defaultProps = {

        title: '실내 자전거',
        img: 'https://dnvefa72aowie.cloudfront.net/origin/article/202104/bce02f7c25d41ea2f758c3322de4596b9768b7fc8822ed6ab1a184fd232c50ce.webp?q=82&s=300x300&t=crop',
        price: '10,000원',
        region: '경기도 용인시 수지구 죽전동',
        like: '관심:3',
        chat: '채팅:5',

    };


export default Post;
